// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract MulticastExploitRouter {
    address public attacker;

    constructor(address _attacker) {
        attacker = _attacker;
    }

    function multicastCall(address[] calldata targets, bytes calldata payload) external {
        require(msg.sender == attacker, "Only attacker");

        for (uint256 i = 0; i < targets.length; i++) {
            (bool success, ) = targets[i].call(payload);
            require(success, "Multicast failed");
        }
    }
}

